CREATE TABLE IF NOT EXISTS test_table
(
    date         DATE                        NOT NULL COMMENT 'Дата',
    mp           VARCHAR(10)                 NOT NULL COMMENT 'Маркетплейс',
    card_id      CHAR(32) charset utf8mb4    null comment 'Идентификатор товара',
    revenue      DECIMAL(15, 2)              null comment 'Выручка',
    orders_count DECIMAL(8)                 null comment 'Кол-во заказов',
    ads_spent    DECIMAL(12)                 null comment 'Рекламные траты',
    ads_orders   DECIMAL(10, 2)                   null comment 'Заказы с рекламы',
    logistic     DECIMAL(10)                 null comment 'Логистика',
    commission   DECIMAL(10, 2)              null comment 'Комиссия',
    holdings     DECIMAL(10, 2)              null comment 'Хранение'
);

CREATE INDEX idx_card_id ON test_table(card_id);

